<script>
export default {
  layout: 'none',
  data() {
    return {
      username: '',
      password: '',
    }
  },

  methods: {
    TogglePasswordType() {
      var elem = document.getElementById('InputEye')
      elem.classList.toggle('CloseEye')
      if (elem.classList.contains('CloseEye'))
        document.getElementById('PasswordInput').type = 'text'
      else document.getElementById('PasswordInput').type = 'password'
    },
    ShowDangerAlert() {
      document.getElementById('DangerModalBox').classList.add('Active');
      setTimeout(() => { document.getElementById('DangerModalBox').classList.remove('Active'); }, 3000);
    },
    async submit() {
      document.getElementById('AlertInputUsernameBox').classList.remove('Active');
      document.getElementById('AlertInputPasswordBox').classList.remove('Active');
      if (this.username == '') return document.getElementById('AlertInputUsernameBox').classList.add('Active');
      if (this.password == '') return document.getElementById('AlertInputPasswordBox').classList.add('Active');

      document.getElementById('LoginButtonInLoginPage').setAttribute('disable', '');
      await fetch(`http://${process.env.server_URL}/account/login`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        credentials: 'include',
        body: JSON.stringify({
          username: this.username,
          password: this.password,
        })
      }).then(async res => {
        let respo = await res.json()
        if (respo.status) {
          await this.$router.push('/')
        } else {
          this.ShowDangerAlert()
        }
      })
    },
  },
}
</script>
